import React from 'react'

const NewTodoForm = (props) => {
  return (

            <form onSubmit={props.formSubmitted}>

            <input />

            <input
                onChange={props.newTodoChanged}
                id="newTodo"
                name="newTodo"
                value={props.newTodo}
                />

              <button type="submit">Add Todo</button>


            </form>
  )
}

export default NewTodoForm
